import "./App.css";
import Form from "./components/Form/Form";
import NewUser from "./components/List/NewUser";

const App = () => {
  const [users, setNewUsers] = useState({
    username: "123",
    age: "123",
  });

  const retrieveData = (prev) =>{
    setNewUsers(prev)
  }

  return (
    <div className="app">
      <Form onHandleSubmit={retrieveData} />
      <NewUser />
    </div>
  );
};

export default App;
